import React from 'react';
import { Container } from 'react-bootstrap';
import './Style.css';

function ContentContainer() {

    return (
        <Container id="content_container" className="cube">
            { /* 
            <div className="cube_face --front">Front</div>
            <div className="cube_face --back">Back</div>
            <div className="cube_face --right">Right</div>
            <div className="cube_face --left">Left</div>
            <div className="cube_face --top">Top</div>
            <div className="cube_face --bottom">Bottom</div>
            */}
        </Container>
      );
}

export default ContentContainer;
